import React, { useState } from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import CreateArea from "./CreateArea";

function App() {

  let note = [{
    title: "test title",
    content: "test content"
  }]

  return (
    <div>
      <Header />
      <CreateArea />
      <Note 
      key={1} 
      title={note.title}
      content={note.content}
      />
      <Footer />
    </div>
  );
}

export default App;
